import React from 'react';
import "./styles/Profile.css";

const profile = (props) => {
    return(
    <div className="profile"> 
        <section className="profileSection">
            <ul>
                <li> <div className="pDiv"><div>Ihre User ID:</div><div className="innerDiv">{props.user.id}</div><button className="button3">Edit</button></div></li>
                <li> <div className="pDiv"><div>Username:</div><div>{props.user.username}</div><button className="button3">Edit</button></div></li>
                <li> <div className="pDiv"><div>Name:</div><div>{props.user.name}</div><button className="button3">Edit</button></div></li>
                <li><div className="pDiv"><div>Vorname:</div><div>{props.user.firstName}</div><button className="button3">Edit</button></div></li>
                <li><div className="pDiv"><div>E-Mail:</div><div>{props.user.email}</div><button className="button3">Edit</button></div></li>
                <li><div className="pDiv"><div>angemeldet seit:</div><div>{props.user.signUpDate}</div><button className="button3">Edit</button></div></li>
            </ul>
        </section>
    </div>
    );
}

export default profile;
